//www.svethardware.cz/vega-frontier-edition-s-titan-xp-srovnani-vykonu-a-tdp/44642",description:'<img src="https://www.svethardware.cz/vega-frontier-edition-s-titan-xp-srovnani-vykonu-a-tdp/44642/img/radeon-vega-100.jpg" alt="articlepicture" width="100" height="100"> <div>Exxact Corporation vypustila do světa další informace o kartách Radeon Pro Vega Frontier Edition, o nichž se dozvíme další podrobnosti o výkonu i spotřebě. Jak si tedy tyto stále ještě chystané karty stojí v porovnání s kartou TITAN Xp? </div>',guid:{"-isPermaLink":"false","#text":"ED1C9.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Fri, 16 Jun 2017 13:20:00 GMT"},{title:"Intel zavádí novou interní sběrnici vícejádrových procesorů",link:"https://www.svethardware.cz/intel-zavadi-novou-interni-sbernici-vicejadrovych-procesoru/44641",description:'<img src="https://www.svethardware.cz/intel-zavadi-novou-interni-sbernici-vicejadrovych-procesoru/44641/img/intel-bus-100.jpg" alt="articlepicture" width="100" height="100"> <div>Vícejádrové procesory si vyžádaly nový přístup Intelu k propojení jejich interních částí. AMD ve svých moderních procesorech využívá Infinity Fabric vyvinutou z Hypertransportu a Intel nově mluví o Mesh Interconnect v procesorech Xeon Scalable. </div>',guid:{"-isPermaLink":"false","#text":"E6615.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Fri, 16 Jun 2017 12:45:00 GMT"},{title:"GlobalFoundries už začínají nabízet výrobu 7nm čipů",link:"https://www.svethardware.cz/globalfoundries-uz-zacinaji-nabizet-vyrobu-7nm-cipu/44640",description:'<img src="https://www.svethardware.cz/globalfoundries-uz-zacinaji-nabizet-vyrobu-7nm-cipu/44640/img/chip-foundry-100.jpg" alt="articlepicture" width="100" height="100"> <div>Společnost GlobalFoundries hodlá z výroby 14nm čipů přeskočit rovnou na 7 nm, v což doufáme především s ohledem na společnost AMD, která chce tento proces hojně využívat. Tato technologie přitom už je v nabídce GlobalFoundries.</div>',guid:{"-isPermaLink":"false","#text":"FAF01.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Fri, 16 Jun 2017 11:50:00 GMT"},{title:"AMD EPYC 7000 v detailech: 12 nových procesorů",link:"https://www.svethardware.cz/amd-epyc-7000-v-detailech-12-novych-procesoru/44639",description:'<img src="https://www.svethardware.cz/amd-epyc-7000-v-detailech-12-novych-procesoru/44639/img/amd-epyc-100.jpg" alt="articlepicture" width="100" height="100"> <div>Na webu se objevily detaily o chystané procesorové rodině AMD EPYC, která nabídne až 32 jader. Ukazuje se, že to funguje podobně jako u procesorů Threadripper, což prostě znamená multiplikaci možností jednotlivých čipů. </div>',guid:{"-isPermaLink":"false","#text":"19640.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Fri, 16 Jun 2017 10:50:00 GMT"},{title:"Moderní výrobní procesy: trubkovité tranzistory přichází",link:"https://www.svethardware.cz/moderni-vyrobni-procesy-trubkovite-tranzistory-prichazi/44588",description:'<img src="https://www.svethardware.cz/moderni-vyrobni-procesy-trubkovite-tranzistory-prichazi/44588/img/tranzistor-100.jpg" alt="articlepicture" width="100" height="100"> <div>IBM se chystá spustit další revoluci ve výrobních procesech čipů, a to podobnou, jakou si připravil Intel při představení prvních tranzistorů Tri-gate před šesti lety. Tehdy ještě šlo o 22nm technologii, která zajistila jeho náskok, ale nyní už jde o 5 nm. <br /></div>',guid:{"-isPermaLink":"false","#text":"FC92E.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Fri, 16 Jun 2017 00:00:00 GMT"},{title:"Přírodní scény ve VR můžou snížit pacientovu bolest u zubaře",link:"https://www.svethardware.cz/prirodni-sceny-ve-vr-muzou-snizit-pacientovu-bolest-u-zubare/44638",description:'<img src="https://www.svethardware.cz/prirodni-sceny-ve-vr-muzou-snizit-pacientovu-bolest-u-zubare/44638/img/vr-priroda-100.jpg" alt="articlepicture" width="100" height="100"> <div>Virtuální realita může být dobrým pomocníkem, pokud je třeba uklidnit pacienty. To bývá často zapotřebí u zubního lékaře. Proto vědci z Velké Británie vyzkoušeli, že přírodní scény ve VR zajistí pacientovi menší bolest.</div>',guid:{"-isPermaLink":"false","#text":"F62AD.svethardware.cz"},"dc:creator":"Kateřina Hoferková",pubDate:"Thu, 15 Jun 2017 15:30:00 GMT"},{title:"AI Microsoftu trénuje na Ms. Pac-Man, dosáhla milionového skóre",link:"https://www.svethardware.cz/ai-microsoftu-trenuje-na-ms-pac-man-dosahla-milionoveho-skore/44637",description:'<img src="https://www.svethardware.cz/ai-microsoftu-trenuje-na-ms-pac-man-dosahla-milionoveho-skore/44637/img/microsoft-pac-man-100.jpg" alt="articlepicture" width="100" height="100"> <div>Umělá inteligence se dá trénovat na lecčemž, třeba i na dlouhá desetiletí staré hře Ms. Pac-Man, kterou známe ještě z éry osmibitových počítačů. Dceřiná společnost Microsoftu Maluuba ukázala, že její AI dokáže dosáhnout nejvyššího možného skóre. </div>',guid:{"-isPermaLink":"false","#text":"287AB.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Thu, 15 Jun 2017 14:07:00 GMT"},{title:"Špionážní satelit prolétl blízko nad ISS, podivná náhoda?",link:"https://www.svethardware.cz/spionazni-satelit-proletl-blizko-nad-iss-podivna-nahoda/44636",description:'<img src="https://www.svethardware.cz/spionazni-satelit-proletl-blizko-nad-iss-podivna-nahoda/44636/img/iss-satelit-100.jpg" alt="articlepicture" width="100" height="100"> <div>Nedávno vypuštěný americký špionážní satelit přelétl relativně blízko přímo nad Mezinárodní vesmírnou stanicí a jak je to možné, to ví pouze NRO - National Reconnaissance Office. Ostatní to vidí buď jako záměr, nebo jako trestuhodnou nedbalost.</div>',guid:{"-isPermaLink":"false","#text":"F0795.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Thu, 15 Jun 2017 13:41:00 GMT"},{title:"Speciální těžební karty GeForce přicházejí",link:"https://www.svethardware.cz/specialni-tezebni-karty-geforce-prichazeji/44635",description:'<img src="https://www.svethardware.cz/specialni-tezebni-karty-geforce-prichazeji/44635/img/nvidia-pascal-krypto-100.jpg" alt="articlepicture" width="100" height="100"> <div>Vypadá to, že právě čínští výrobci hardwaru vycítili příležitost, jak vydělat na prodeji specializovaného hardwaru pro těžbu kryptoměn. Připravili nejen specializované systémy s P106, ale také s mnohem výkonnějšími P104 generace Pascal. </div>',guid:{"-isPermaLink":"false","#text":"FE09D.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Thu, 15 Jun 2017 10:20:00 GMT"},{title:"Dell UltraSharp 38: potřebujete velký panel?",link:"https://www.svethardware.cz/dell-ultrasharp-38-potrebujete-velky-panel/44634",description:'<img src="https://www.svethardware.cz/dell-ultrasharp-38-potrebujete-velky-panel/44634/img/dell-ultrasharp-38-100.jpg" alt="articlepicture" width="100" height="100"> <div>Dell si připravil nový monitor UltraSharp 38 s LCD panelem o úhlopříčce 37,5", který je určen pro opravdové nadšence neváhající za takové zařízení vydat značnou sumu. Co za ni ale dostanou? </div>',guid:{"-isPermaLink":"false","#text":"F61FB.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Thu, 15 Jun 2017 10:00:00 GMT"},{title:"Ploštěnci na palubě ISS vyrostly dvě hlavy",link:"https://www.svethardware.cz/plostenci-na-palube-iss-vyrostly-dve-hlavy/44633",description:'<img src="https://www.svethardware.cz/plostenci-na-palube-iss-vyrostly-dve-hlavy/44633/img/plostenec-100.jpg" alt="articlepicture" width="100" height="100"> <div>Na palubě Mezinárodní vesmírné stanice (ISS) probíhají různé experimenty, které ukazují, že se máme o stavu beztíže ještě co učit. Jeden z nich totiž měl za následek, že jednomu ze zkoumaných ploštěnců narostla další hlava. </div>',guid:{"-isPermaLink":"false","#text":"B9F0C.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Wed, 14 Jun 2017 14:32:00 GMT"},{title:"Microsoft zabezpečuje Windows proti ransomware, včetně XP",link:"https://www.svethardware.cz/microsoft-zabezpecuje-windows-proti-ransomware-vcetne-xp/44632",description:'<img src="https://www.svethardware.cz/microsoft-zabezpecuje-windows-proti-ransomware-vcetne-xp/44632/img/windows-10-logo-100.jpg" alt="articlepicture" width="100" height="100"> <div>Microsoft se rozhodl vytáhnout do boje proti ransomware, a to s využitím dodatečných bezpečnostních aktualizací, které by měly poskytnout další ochranu. Navíc je připravuje i pro Windows XP, pro které už jinak neplatí ani rozšířená podpora.</div>',guid:{"-isPermaLink":"false","#text":"9035C.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Wed, 14 Jun 2017 14:00:00 GMT"},{title:"Grafen může pomoci velice rychle diagnostikovat vážné nemoci",link:"https://www.svethardware.cz/grafen-muze-pomoci-velice-rychle-diagnostikovat-vazne-nemoci/44631",description:'<img src="https://www.svethardware.cz/grafen-muze-pomoci-velice-rychle-diagnostikovat-vazne-nemoci/44631/img/grafen-nemoci-100.jpg" alt="articlepicture" width="100" height="100"> <div>HIV už není takový strašák, jaký býval, ale právě i to přispívá k jeho dalšímu šíření i ve vyspělých zemích. K jeho odhalování by mohl v dohledné době posloužit chemicky upravený grafen, stejně jako k diagnostikování jiných onemocnění. </div>',guid:{"-isPermaLink":"false","#text":"7B1F2.svethardware.cz"},"dc:creator":"Jan Vítek",pubDate:"Wed, 14 Jun 2017 13:16:00 GMT"}]}}}},function(t,e,n){"use strict";function r(t){if(t&&t.__esModule)return t;var e={};if(null!=t)for(var n in t)Object.prototype.hasOwnProperty.call(t,n)&&(e[n]=t[n]);return e["default"]=t,e}function o(t){return t&&t.__esModule?t:{"default":t}}function i(t,e){if(!(t instanceof e))throw new TypeError("Cannot call a class as a function")}function a(t,e){if(!t)throw new ReferenceError("this hasn't been initialised - super() hasn't been called");return!e||"object"!=typeof e&&"function"!=typeof e?t:e}function s(t,e){if("function"!=typeof e&&null!==e)throw new TypeError("Super expression must either be null or a function, not "+typeof e);t.prototype=Object.create(e&&e.prototype,{constructor:{value:t,enumerable:!1,writable:!0,configurable:!0}}),e&&(Object.setProt